import React, { useEffect, useState, useContext } from 'react';

const Iframe = props => {
    if (props.iframeCode) {
        return (
            <div className='video-player'>
                <meta itemProp="name" content={ props.meta.title }/>
                <meta itemProp="description" content={ props.meta.description }/>
                <meta itemProp="duration" content="P0DT0H8M12S"/>
                <meta itemProp="thumbnailUrl" content="https://thumb-v-cl2.xhcdn.com/a/pdi9dO5JpdngCdZ4Y0NlWA/007/435/278/1280x720.3.jpg"/>
                <meta itemProp="embedURL" content="https://xhamster.com/embed/7435278"/>
                <meta itemProp="uploadDate" content="2019-09-06T22:51:23+00:00"/>
                <iframe src={ props.iframeCode } frameBorder="0" width='640' height='360' scrolling="no"/>
            </div>
        );
    } else return null

};
export default Iframe;
